<div class="elNetworkObjectLib-readOnly">
    <div class="elNetworkObjectLib-readOnly-key">{{key}}</div>
    <div class="elNetworkObjectLib-readOnly-value" title="{{value}}">{{value}}</div>
    <div class="elNetworkObjectLib-readOnly-collections">
    <ul class ="ebList ebList_striped elNetworkObjectLib-readOnly-list">
        {{#each collections}}
        <li class ="ebList-item elNetworkObjectLib-readOnly-collections-filterItem">
           {{this}}
        </li>
        {{/each}}
    </ul>
    </div>
</div>
